import React from 'react';
import "./Main.css";
import { observer } from "mobx-react";
import MenuBar from '../MenuBar/MenuBar';
import { action, observable } from 'mobx';
import { ColorScheme } from "../ColorScheme";
import Repositories from '../Repositories/Repositories';
import scrabblemini from "../Assets/scrabblemini.png";

interface LoadManager {
    MenuLoaded: boolean;
    RepositoriesLoaded: boolean;
}

export const ImageMapping = new Map<string, string>([]);

@observer
export default class Main extends React.Component<{}> {
    @observable private loadManager: LoadManager = {
        MenuLoaded: false,
        RepositoriesLoaded: false
    }
    @observable private currentPage = 0;

    onMenuLoaded = action(() => {
        this.loadManager.MenuLoaded = true;
    })

    onRepositoriesLoaded = action(() => {
        this.loadManager.RepositoriesLoaded = true;
    });

    renderPage = () => {
        console.log(this.currentPage);
        return this.currentPage === 1 ? <Repositories
            onLoad={this.onRepositoriesLoaded}
        /> : null
    }

    render() {
        const { MenuLoaded } = this.loadManager;
        return (
            <div
                className={'outermost'}
                style={{ background: MenuLoaded ? ColorScheme.primary : "white" }}
            >
                <MenuBar
                    onLoad={this.onMenuLoaded}
                    transitionDuration={1500}
                    currentPage={this.currentPage}
                    setCurrentPage={action((page: number) => {
                        this.currentPage = page;
                    })}
                />
                <div
                    className={"body"}
                    style={{
                        opacity: MenuLoaded ? 1 : 0,
                    }}
                >
                    <div className={'image-container'}>
                        <img
                            className={"logo"}
                            alt={"logo"}
                            src={scrabblemini}
                        />
                    </div>
                    {this.currentPage === 1 ? <Repositories
                        onLoad={this.onRepositoriesLoaded}
                    /> : null}
                </div>
            </div>
        );
    }

}
